script: |
  super -f text -I q10045.spq | sort > q10045.out

inputs:
  - name: q10045.spq
    data: |
      SELECT DISTINCT + 50 AS col1, col2 * ( - col0 ) FROM tab1 (FORMAT parquet) WHERE + col0 NOT BETWEEN + 30 AND 69;
  - name: tab1

outputs:
  - name: q10045.out
    data: |
      50	-5015
      50	-6188
